import Icon from '@ant-design/icons'

function UserSVG() {
  return (
    <svg
      data-name="Layer 6"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      viewBox="0 0 1024 1024"
    >
      <image
        width={1000}
        height={1000}
        transform="matrix(1.03 0 0 1.03 6.26 6.3)"
        xlinkHref="data:image/svg+xml;base64,"
      />
    </svg>
  )
}
export const UserLogIcon = (props: any) => (
  <Icon
    component={UserSVG}
    {...props}
    // style={{ display: 'block', margin: '2px -11px' }}
  />
)
